    /** ------------------------------ 2.0.1 - ---------------------------- */
    @Test
    void shouldDecodeProtobufClientSideSamples_v201() throws Throwable {
        var message = Base64.decode("");
        var decoder = SamplesDecoder.builder(logger)
                .withFormatType(TransportFormatType.PROTOBUF)
                .withVersion(VERSION_V201)
                .build();
        decoder.decode(message);
    }

